import React from "react";
import smileyHappy from "../images/smiley-happy.png";

const SmileyFace = () => {
  //style the img tag

  return (
    <div>
      <img
        src={smileyHappy}
        alt="Smiley Face"
        className="smileyFace"
        style={{
          width: "50%",
          height: "10%",
          marginLeft: "25%",
          marginRight: "25%",
        }}
      />
      <p>good job!</p>
    </div>
  );
};

export default SmileyFace;
